import React from "react";

import Navbar from "../../components/navbar";
import Body from "../../components/body";
import SocialLinks from "../../components/socialLinks";
import Ovazi from "../../assets/ovazi";

import { Grid, Typography } from "@material-ui/core";

import withStyles from "./styles";

class Experience extends React.Component {
  renderSocialLinks = () => {
    const { classes } = this.props;
    return (
      <div className={classes.socialLinkContainer}>
        <SocialLinks />
      </div>
    );
  };

  render() {
    const { classes } = this.props;
    return (
      <div>
        <Navbar />
        <Body>
          {this.renderSocialLinks()}
          <Grid container justify="center" alignContent="center">
            <div className={classes.container}>
              <Typography
                variant="headline"
                inline={true}
                className={classes.number}
              >
                02.
              </Typography>
              <Typography
                variant="headline"
                inline={true}
                className={classes.pageTitle}
              >
                Experience
              </Typography>
              <Grid container>
                <Grid item xs={4} className={classes.jobImgContainer}>
                  <img
                    src={"/static/elevenfifty.png"}
                    className={classes.img}
                  />
                </Grid>
                <Grid item xs={8}>
                  <Typography>Eleven Fifty</Typography>
                </Grid>
              </Grid>
              <Grid container>
                <Grid item xs={6} className={classes.jobImgContainer}>
                  <img src={"/static/torchlite.jpg"} className={classes.img} />
                </Grid>
                <Grid item xs={6}>
                  <Typography>Torchlite</Typography>
                </Grid>
              </Grid>
              <Grid container>
                <Grid item xs={6} className={classes.jobImgContainer}>
                  <img src={Ovazi} className={classes.img} />
                </Grid>
                <Grid item xs={6}>
                  <Typography>Torchlite</Typography>
                </Grid>
              </Grid>
            </div>
          </Grid>
        </Body>
      </div>
    );
  }
}

export default withStyles(Experience);
